BEGIN
	declare @x xml = EVENTDATA();
	declare @tableName sysname; 
	set @tableName = @x.value(N'(/EVENT_INSTANCE/ObjectName)[1]', N'sysname');
	SELECT sm.object_id AS TableID, OBJECT_NAME(sm.object_id) AS TableName 
	FROM sys.dm_db_index_physical_stats(DB_ID(),OBJECT_ID(@tableName),null,null,null) as sm 
	SELECT create_date FROM sys.tables where name = @tableName
END

DECLARE @NEWMONSTER TABLE (Id INT, NextMonsterId INT, [Name] NVARCHAR(50), ThreatLevel NVARCHAR(50), Class NVARCHAR(50)) INSERT INTO @NEWMONSTER(Id, NextMonsterId, Name, ThreatLevel, Class) SELECT Id, Id + 1, [Name], ThreatLevel, Class FROM Monster;
WITH DirectReports (Id, NextMonsterId, Name, ThreatLevel, Class, Level) AS ( SELECT Id, Id + 1 AS NextMonster, Name, ThreatLevel, Class, 0 AS Level FROM Monster WHERE Id = @monsterid UNION ALL
SELECT N.Id, N.NextMonsterId, N.[Name], D.ThreatLevel, D.Class, Level + 1 FROM @NEWMONSTER AS N INNER JOIN DirectReports AS D ON N.Id = d.NextMonsterId ) SELECT * FROM DirectReports WHERE Id <> @monsterid - 1;

